import React from 'react'


function NavBar() {
    return (
        <div>
  <ul>
  <li className="navbar-li"><a class="active" href="/">Home</a></li>
  <li className="navbar-li"><a href="/users">Users</a></li>
  <li className="navbar-li"><a href="/edit">Edit</a></li>
</ul>
        </div>
    )
}

export default NavBar
